              <div class="stl_01" style="top: 0.5991em; left:13.4717em;"><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0775em;">施耐德 </span><span class="stl_10 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0775em;">PLC</span><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0775em;">以太网连接的 </span><span class="stl_10 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0775em;">IP</span><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0775em;">地址设定 &nbsp;</span></div>
              <div class="stl_01" style="top: 3.3271em; left:7.502em;"><span class="stl_11 stl_12 stl_13">施耐德</span><span class="stl_11 stl_12 stl_13" style="word-spacing:0.0748em;">&nbsp;</span><span class="stl_14 stl_12 stl_13" style="word-spacing:0.0748em;">PLC</span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.1635em;">&nbsp;</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.1635em;">与</span><span class="stl_11 stl_12 stl_13" style="word-spacing:0.0752em;">&nbsp;</span><span class="stl_14 stl_12 stl_13" style="word-spacing:0.0752em;">SS700</span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.1638em;">&nbsp;</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.1638em;">通过以太网连接时，必须通过</span><span class="stl_11 stl_12 stl_13" style="word-spacing:0.0777em;">&nbsp;</span><span class="stl_14 stl_12 stl_13" style="word-spacing:0.0777em;">SoMachine</span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.1752em;">&nbsp;</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.1752em;">软件设置成与</span><span class="stl_11 stl_12 stl_13" style="word-spacing:0.0886em;">&nbsp;</span><span class="stl_14 stl_12 stl_13" style="word-spacing:0.0886em;">SS700</span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.1638em;">&nbsp;</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.1638em;">同网段的</span><span class="stl_11 stl_12 stl_13" style="word-spacing:0.0858em;">&nbsp;</span><span class="stl_14 stl_12 stl_13" style="word-spacing:0.0858em;">IP &nbsp;</span></div>
              <div class="stl_01" style="top: 4.8171em; left:5.752em;"><span class="stl_11 stl_12 stl_15">地址。 &nbsp;</span></div>
              <div class="stl_01" style="top: 6.8171em; left:7.502em;z-index:96; "><span class="stl_11 stl_12 stl_16" style="word-spacing:-0.0576em;">在设置之前要确保进行设置的 </span><span class="stl_14 stl_12 stl_16" style="word-spacing:-0.0576em;">PLC</span><span class="stl_11 stl_12 stl_16" style="word-spacing:-0.0576em;">处于运行状态</span><span class="stl_11 stl_12 stl_15" style="word-spacing:-0.2621em;">&nbsp;</span><span class="stl_11 stl_12 stl_17">，有</span><span class="stl_11 stl_12 stl_15" style="word-spacing:0.239em;">&nbsp;</span><span class="stl_11 stl_12 stl_18" style="word-spacing:-0.0456em;">两种方法让 </span><span class="stl_14 stl_12 stl_18" style="word-spacing:-0.0456em;">PLC</span><span class="stl_11 stl_12 stl_18" style="word-spacing:-0.0456em;">与进行编辑的电脑进行连接： &nbsp;</span></div>
              <div class="stl_01" style="top: 8.8088em; left:7.502em;z-index:130; "><span class="stl_11 stl_12 stl_19" style="word-spacing:0.0295em;">方法 </span><span class="stl_14 stl_12 stl_19" style="word-spacing:0.0295em;">A</span><span class="stl_11 stl_12 stl_19" style="word-spacing:0.0295em;">：</span><span class="stl_14 stl_12 stl_19" style="word-spacing:0.0295em;">PLC</span><span class="stl_11 stl_12 stl_19" style="word-spacing:0.0295em;">通过 </span><span class="stl_14 stl_12 stl_19" style="word-spacing:0.0295em;">DHCP</span><span class="stl_11 stl_12 stl_19" style="word-spacing:0.0295em;">（自动获取 </span><span class="stl_14 stl_12 stl_19" style="word-spacing:0.0295em;">IP</span><span class="stl_11 stl_12 stl_19" style="word-spacing:0.0295em;">）方式与上级路由采用网线连接，然后电脑再连接该路由器。 &nbsp;</span></div>
              <div class="stl_01" style="top: 33.4113em; left:7.502em;"><span class="stl_11 stl_12 stl_20" style="word-spacing:0.0029em;">方法 </span><span class="stl_14 stl_12 stl_20" style="word-spacing:0.0029em;">B</span><span class="stl_11 stl_12 stl_20" style="word-spacing:0.0029em;">：</span><span class="stl_14 stl_12 stl_20" style="word-spacing:0.0029em;">PLC</span><span class="stl_11 stl_12 stl_20" style="word-spacing:0.0029em;">直接通过网线与电脑连接，此时电脑的有线连接要设成固定 </span><span class="stl_14 stl_12 stl_20" style="word-spacing:0.0029em;">IP</span><span class="stl_11 stl_12 stl_20" style="word-spacing:0.0029em;">，使之与 </span><span class="stl_14 stl_12 stl_20" style="word-spacing:0.0029em;">PLC</span><span class="stl_11 stl_12 stl_20" style="word-spacing:0.0029em;">同网段 &nbsp;</span></div>
              <div class="stl_01" style="top: 34.9013em; left:6.632em;z-index:221; "><span class="stl_11 stl_12 stl_21">子网掩码也要相同</span><span class="stl_11 stl_12 stl_15" style="word-spacing:-0.261em;">&nbsp;</span><span class="stl_11 stl_12 stl_17">）。</span><span class="stl_11 stl_12 stl_15" style="word-spacing:0.239em;">&nbsp;</span><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.0604em;">在这里小编采取这种方法进行 </span><span class="stl_14 stl_12 stl_22" style="word-spacing:-0.0604em;">PLC</span><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.0604em;">固定 </span><span class="stl_14 stl_12 stl_22" style="word-spacing:-0.0604em;">IP </span><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.0604em;">的设定，通过查看 </span><span class="stl_14 stl_12 stl_22" style="word-spacing:-0.0604em;">PLC</span><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.0604em;">默认 </span><span class="stl_14 stl_12 stl_22" style="word-spacing:-0.0604em;">IP </span><span class="stl_11 stl_12 stl_22" style="word-spacing:-0.0604em;">地 &nbsp;</span></div>
              <div class="stl_01" style="top: 34.9013em; left:5.752em;"><span class="stl_11 stl_12 stl_15">（</span></div>
              <div class="stl_01" style="top: 36.4013em; left:5.752em;"><span class="stl_11 stl_12 stl_23" style="word-spacing:-0.0026em;">址为：</span><span class="stl_14 stl_12 stl_23" style="word-spacing:-0.0026em;">10.10.15.247</span><span class="stl_11 stl_12 stl_23" style="word-spacing:-0.0026em;">；子网掩码为：</span><span class="stl_14 stl_12 stl_23" style="word-spacing:-0.0026em;">255.0.0.0</span><span class="stl_11 stl_12 stl_23" style="word-spacing:-0.0026em;">，则电脑有线连接固定 </span><span class="stl_14 stl_12 stl_23" style="word-spacing:-0.0026em;">IP</span><span class="stl_11 stl_12 stl_23" style="word-spacing:-0.0026em;">设定如下： &nbsp;</span></div>
              <div class="stl_01" style="top: 67.4951em; left:7.502em;"><span class="stl_11 stl_12 stl_24">为了确保成功连接并显示</span><span class="stl_11 stl_12 stl_24" style="word-spacing:0.0906em;">&nbsp;</span><span class="stl_14 stl_12 stl_24" style="word-spacing:0.0906em;">PLC</span><span class="stl_14 stl_12 stl_24" style="word-spacing:-0.16em;">&nbsp;</span><span class="stl_11 stl_12 stl_24" style="word-spacing:-0.16em;">的默认</span><span class="stl_11 stl_12 stl_24" style="word-spacing:0.101em;">&nbsp;</span><span class="stl_14 stl_12 stl_24" style="word-spacing:0.101em;">IP</span><span class="stl_14 stl_12 stl_24" style="word-spacing:-0.1487em;">&nbsp;</span><span class="stl_11 stl_12 stl_24" style="word-spacing:-0.1487em;">地址，电脑无线连接也要暂时禁用（没有无线网卡的电 &nbsp;</span></div>
              <div class="stl_01" style="top: 68.9951em; left:5.752em;z-index:357; "><span class="stl_11 stl_12 stl_25">脑无需此操作）： &nbsp;</span></div>
