              <div class="stl_01" style="top: 12.4288em; left:7.502em;"><span class="stl_11 stl_12 stl_26" style="word-spacing:-0.036em;">现在正式介绍 </span><span class="stl_14 stl_12 stl_26" style="word-spacing:-0.036em;">PLC</span><span class="stl_11 stl_12 stl_26" style="word-spacing:-0.036em;">固定 </span><span class="stl_14 stl_12 stl_26" style="word-spacing:-0.036em;">IP</span><span class="stl_11 stl_12 stl_26" style="word-spacing:-0.036em;">的设定，设置步骤如下： &nbsp;</span></div>
              <div class="stl_01" style="top: 14.4188em; left:7.482em;"><span class="stl_11 stl_12 stl_27" style="word-spacing:-0.0096em;">※第一步：打开 </span><span class="stl_14 stl_12 stl_27" style="word-spacing:-0.0096em;">SoMachine</span><span class="stl_11 stl_12 stl_27" style="word-spacing:-0.0096em;">软件，点击“连接控制器”。 &nbsp;</span></div>
              <div class="stl_01" style="top: 38.9329em; left:7.482em;z-index:88; "><span class="stl_11 stl_12 stl_28">※第二步：选择设置的设备后，右键点击然后左键点击“处理通讯设置”。 &nbsp;</span></div>
              <div class="stl_01" style="top: 67.2351em; left:7.482em;z-index:114; "><span class="stl_11 stl_12 stl_29">※第三步：在跳出对话框后，启动模式选择“已修复</span><span class="stl_11 stl_12 stl_15" style="word-spacing:-0.25em;">&nbsp;</span><span class="stl_11 stl_12 stl_17">”，</span><span class="stl_11 stl_12 stl_15" style="word-spacing:0.239em;">&nbsp;</span><span class="stl_11 stl_12 stl_30" style="word-spacing:-0.0675em;">然后设定 </span><span class="stl_14 stl_12 stl_30" style="word-spacing:-0.0675em;">IP</span><span class="stl_11 stl_12 stl_30" style="word-spacing:-0.0675em;">地址。由于 </span><span class="stl_14 stl_12 stl_30" style="word-spacing:-0.0675em;">SS700</span><span class="stl_11 stl_12 stl_30" style="word-spacing:-0.0675em;">的 &nbsp;</span></div>
              <div class="stl_01" style="top: 68.5351em; left:5.732em;"><span class="stl_11 stl_12 stl_31" style="word-spacing:-0.0159em;">默认网关为 </span><span class="stl_14 stl_12 stl_31" style="word-spacing:-0.0159em;">192.168.200.1</span><span class="stl_11 stl_12 stl_31" style="word-spacing:-0.0159em;">，子网掩码为：</span><span class="stl_14 stl_12 stl_31" style="word-spacing:-0.0159em;">255.255.255.0</span><span class="stl_11 stl_12 stl_31" style="word-spacing:-0.0159em;">，小编把该 </span><span class="stl_14 stl_12 stl_31" style="word-spacing:-0.0159em;">PLC</span><span class="stl_11 stl_12 stl_31" style="word-spacing:-0.0159em;">的 </span><span class="stl_14 stl_12 stl_31" style="word-spacing:-0.0159em;">IP</span><span class="stl_11 stl_12 stl_31" style="word-spacing:-0.0159em;">地址设为： &nbsp;</span></div>
